import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
  import {Home} from "../pages/Home"
  



class Nav extends Component {
    render() {
        return (  
            <div>
                <Switch>
                    <Route path='/' component={Home}/>
                </Switch>
            </div>
        );
    }
}

export default Nav;
